const Carousel = () => {
    const classes = useStyles()
    const slider = (
        <AwesomeSlider>
          <div>1</div>
          <div>2</div>
          <div>3</div>
          <div>4</div>
        </AwesomeSlider>
      );
    return (
        <>
        </>
    )
}

export default Carousel
